    return(
        <div style={{height: Height, width: Width, fontSize: FontSize, fontWeight: FontWeight}} className='border border-solid border-gray-300 rounded-xl'>
            <div className='my-4 mx-6'>
                {/* <img src={netflix} alt=""/> */}
                <div className='flex flex-row'>
                <PlayIcon className="h-6 w-6 text-red-500" />
                <div>
{JobTitle}
                </div>
                </div>
<button
              class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              type="button"
            >
              {ButtonText}
            </button>
            </div>

        </div>
    )
}

export default ApplyNowButtonCard;
